import {connect} from 'react-redux'

class taskList extends Component{
    constructor(){
        super()
    }

    state = {
        item: [
            {
                id: 1,
                due: 'no due date',
                text: 'do this'
            },
            {
                id: 2,
                due: 'no due date',
                text: 'do that'
            },
            {
                id: 3,
                due: 'april 1st',
                text: 'do them'
            }
        ]
    }

    render(){
        return(
            /*
            <ul>
                {this.props.item.map(
                    item =>
                    <li key={item.id}>
                        <input type="checkbox" value={item.id}> {item.text} </input>
                    </li>
                )}
            </ul>
            */
           <h1>test</h1>
        );
    }
}

const mapToStateProps = (state) => {
    return{
        item: state.todo
    }
}

export default connect(mapToStateProps)(taskList)
